import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import LoginPage from './pages/LoginPage';
import DashboardPage from './pages/DashboardPage';
import ShipsPage from './pages/ShipsPage';
import ComponentsPage from './pages/ComponentsPage';
import JobsPage from './pages/JobsPage';
import JobCalendar from './components/Jobs/JobCalendar';
import PrivateRoute from './components/PrivateRoute';
import Navbar from './components/Navbar';

const ProtectedLayout = ({ children }) => (
  <>
    <Navbar />
    {children}
  </>
);

const App = () => (
  <AuthProvider>
    <Router>
      <Routes>
        {/* Public Route */}
        <Route path="/" element={<LoginPage />} />

        {/* Protected Routes */}
        <Route
          path="/dashboard"
          element={
            <PrivateRoute>
              <ProtectedLayout>
                <DashboardPage />
              </ProtectedLayout>
            </PrivateRoute>
          }
        />
        <Route
          path="/ships"
          element={
            <PrivateRoute>
              <ProtectedLayout>
                <ShipsPage />
              </ProtectedLayout>
            </PrivateRoute>
          }
        />
        <Route
          path="/components"
          element={
            <PrivateRoute>
              <ProtectedLayout>
                <ComponentsPage />
              </ProtectedLayout>
            </PrivateRoute>
          }
        />
        <Route
          path="/jobs"
          element={
            <PrivateRoute>
              <ProtectedLayout>
                <JobsPage />
              </ProtectedLayout>
            </PrivateRoute>
          }
        />
        <Route
          path="/jobcalendar"
          element={
            <PrivateRoute>
              <ProtectedLayout>
                <JobCalendar />
              </ProtectedLayout>
            </PrivateRoute>
          }
        />
      </Routes>
    </Router>
  </AuthProvider>
);

export default App;
